import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
    const navigate = useNavigate();

    return (
        <div>
            <h2>Dashboard</h2>
            <button onClick={() => navigate("/admin/add-news")}>Add News</button>
            <button onClick={() => navigate("/admin/view-news")}>View All News</button>
            <button onClick={() => navigate("/update-news")}>Update News</button>
            <button onClick={() => navigate("/delete-news")}>Delete News</button>
        </div>
    );
};

export default Dashboard;
